import { useEffect, useState } from "react";
import { Col, Container, Nav, Row, Navbar } from "react-bootstrap";
import Link from "next/link";
import MediaEnums from "../../../enums/MediaEnums";
import { useDispatch, useSelector } from "react-redux";
import { setAds, setKategoriler } from "../../../redux/app/actions";
import pointsU from "points";
import { getData } from "utils/fetchData";

export default function NavbarMenu() {
    const [data, setData] = useState();
    const [acil, setAcil] = useState();
    const sosyal = useSelector(state => state.App.sosyallar);
    const adsStore = useSelector(state => state.App?.ads?.header ?? []);
    const [count, setCount] = useState(0);
    const bb = adsStore?.length;
    const dispatch = useDispatch();

    useEffect(() => {
        const fetchData = async () => {
            var res = await getData(config.apiUrl , pointsU.sgetCategorys)
            setData(res.data);
            dispatch(setKategoriler(res.data));


            var result = await getData(pointsU.siteGetAds);
            
            appServices.getRequests().then((res) => {
       
            })
        }
        fetchData()
    }, []);

    useEffect(() => {
        setInterval(() => {
                setCount(count+1);
        }, 5000);
        // return () => clearInterval(interval);
    }, []);


    const IfNotData = () => {
        if (data?.length > 0) return "";
        return (
            <>
                <Link className="nav-link" href={"kategori/"}>اخبار وتقارير</Link>
                <Link className="nav-link" href={"kategori/"}>محليات</Link>
                <Link className="nav-link" href={"kategori/"}>شؤون دولية</Link>
                <Link className="nav-link" href={"kategori/"}>رياضة</Link>
                <Link className="nav-link" href={"kategori/"}>منوعات</Link>
                <Link className="nav-link" href={"kategori/"}>كتابات</Link>
                <Link className="nav-link" href={"kategori/"}>ميديا</Link>
                <Link className="nav-link" href={"kategori/"}>كورونا</Link>
                <Link className="nav-link" href={"kategori/"}>من نحن</Link>
            </>
        )
    }

    return (
        <header>
            <div className="header-area">
                <div className="main-header ">
                    <div className="header-top black-bg  d-md-block">
                        <Container>
                            <Row>
                                <Col xs={12} sm={6}>
                                    <div className="header-info-right">
                                        <ul className="header-social  m-b-0">
                                            {
                                                sosyal?.map((n, i) => {
                                                    return (
                                                        <li>
                                                            <a href={n?.url}>     {
                                                                MediaEnums?.map(m => {
                                                                    if (n?.name === m?.value) {
                                                                        return (
                                                                            m.icon
                                                                        )
                                                                    }
                                                                })
                                                            }</a>
                                                        </li>
                                                    )
                                                })
                                            }
                                        </ul>
                                    </div>
                                </Col>
                                <Col xs={12} sm={6}>
                                    <div className="header-info-left text-left">
                                        <ul className="m-b-0">
                                            <li style={{ marginRight: 0 }}><img src="assets/img/icon/header_icon1.png" alt="" />34ºc, Sunny </li>
                                            <li><img src="assets/img/icon/header_icon1.png" alt="" />Tuesday, 18th June, 2019
                                            </li>
                                        </ul>
                                    </div>
                                </Col>
                            </Row>
                        </Container>
                    </div>
                    <div className="header-mid  d-md-block p-0">
                        <Container>
                            <Row>
                                <Col sm={9}>
                                    <div>
                                        {/* <a href={adsStore[count]?.url}><img src={adsStore[count]?.url ? "data:image/jpeg;base64," + adsStore[count]?.photo64 : ads} style={{ width: "80%", height: "70px", margin: "20px" }} alt={adsStore[count]?.name} /></a> */}
                                    </div>
                                </Col>
                                <Col sm={3}>
                                    <div className="logo p-t-10 p-m-10 text-left">
                                        <a href="index.html"><img src="/assets/images/logo.png" style={{ width: "100%", height: "80%" , marginLeft : "10px"}} alt="" /></a>
                                    </div>
                                </Col>
                            </Row>
                        </Container>
                        <Navbar bg="light" expand="lg">
                            <Container>
                                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                                <Navbar.Collapse id="basic-navbar-nav">
                                    <Nav>
                                        <Link className="nav-link" href={""} active="true" >الصفحة الرئيسية</Link>
                                        {
                                            data?.map((v, i) => (
                                                <Link className="nav-link" onClick={(e) => { window.location.assign("/" + v.name + "/" + v.id) }} to={"/" + v.name + "/" + v.id}>{v.name}</Link>
                                            ))
                                        }
                                    </Nav>
                                </Navbar.Collapse>
                            </Container>
                        </Navbar>
                    </div>

                </div>
            </div>
        </header>
    )
}
